  false,\n\t\"url\": null,\n\t\"notes\": \"The objectives of this study are twofold:
  (1) To determine the current status of coral reef fishes and their habitat throughout
  the Samoan Archipelago. This will be based on a series of detailed, quantitative
  surveys of reefs on eight islands in the archipelago. The information collected
  in this survey will also provide a quantitative basis for the long term monitoring
  of these reefs. (2) To present the results of this study in a format that is useful
  to local managers of this important resource.\",\n\t\"license_title\": \"License
